import CodeGenerated from './components/CodeGenerated';
import Content from './components/Content';
import Footer from './components/Footer';
import Title from './components/Title';

function App() {
  document.title='Shortener'
  return (
    <div className="App">
      <Title />
      <Content />
      <Footer />
      <CodeGenerated />
    </div>
  );
}

export default App;
